document.addEventListener('DOMContentLoaded', () => {
    // -------------------------------------------------------------------------
    // >> مرحله 1: رشته های Base64 Data URL صداهای خود را اینجا قرار دهید <<
    // -------------------------------------------------------------------------
    // مثال (شما باید رشته های واقعی خود را جایگزین کنید):
    // const kickBase64 = 'data:audio/wav;base64,UklGRiYAAABXQVZFZm10IBAAAAABAAEARKwAAIhYAQACABAAAABkYXRhAgAAAAEA';
    // const snareBase64 = 'data:audio/wav;base64,...'; // (رشته طولانی تر)
    // و غیره برای بقیه صداها

    // !! مهم: رشته های Base64 واقعی خود را اینجا جایگزین کنید !!
    const hihatClosedBase64 = ''; // <--- جایگزین کنید
    const hihatOpenBase64 = '';   // <--- جایگزین کنید
    const kickBase64 = '';             // <--- جایگزین کنید
    const snareBase64 = '';           // <--- جایگزین کنید
    // -------------------------------------------------------------------------

    const sounds = [
        { name: 'Hihat Closed', path: hihatClosedBase64, buffer: null },
        { name: 'Hihat Open', path: hihatOpenBase64, buffer: null },
        { name: 'Kick', path: kickBase64, buffer: null },
        { name: 'Snare', path: snareBase64, buffer: null },
        // می توانید صداهای بیشتری اضافه کنید
    ];

    let audioContext;
    let bpm = 120;
    let numSteps = 16;
    let currentStep = 0;
    let isPlaying = false;
    let intervalId = null;
    let pattern = [];

    const playPauseBtn = document.getElementById('play-pause-btn');
    const bpmInput = document.getElementById('bpm');
    const stepsCountSelect = document.getElementById('steps-count');
    const sequencerGridDiv = document.getElementById('sequencer-grid');
    const stepIndicatorsDiv = document.querySelector('.step-indicators');
    const patternNameInput = document.getElementById('pattern-name');
    const savePatternBtn = document.getElementById('save-pattern-btn');
    const loadPatternBtn = document.getElementById('load-pattern-btn');

    function initAudioContext() {
        if (!audioContext) {
            audioContext = new (window.AudioContext || window.webkitAudioContext)();
        }
    }

    // تابع کمکی برای تبدیل Data URL به ArrayBuffer
    async function dataUrlToArrayBuffer(dataUrl) {
        const response = await fetch(dataUrl);
        if (!response.ok) {
            throw new Error(`Failed to fetch data URL: ${response.statusText}`);
        }
        return await response.arrayBuffer();
    }

    async function loadSound(soundObj) {
        if (!audioContext) initAudioContext();
        console.log(`Attempting to load from Data URL: ${soundObj.name}`);
        try {
            // دیگر نیازی به fetch از مسیر فایل نیست، مستقیماً Data URL را پردازش می کنیم
            const arrayBuffer = await dataUrlToArrayBuffer(soundObj.path); // path حاوی Data URL است

            console.log(`Received ArrayBuffer for ${soundObj.name}, size: ${arrayBuffer.byteLength} bytes`);
            if (arrayBuffer.byteLength === 0) {
                throw new Error(`Received empty ArrayBuffer for ${soundObj.name}`);
            }

            soundObj.buffer = await audioContext.decodeAudioData(arrayBuffer);
            console.log(`Successfully decoded: ${soundObj.name}`);
        } catch (error) {
            console.error(`Error loading or decoding sound ${soundObj.name}:`, error);
            alert(`خطا در بارگذاری یا رمزگشایی صدای ${soundObj.name}. جزئیات بیشتر در کنسول (F12) موجود است.`);
        }
    }

    async function loadAllSounds() {
        playPauseBtn.disabled = true;
        playPauseBtn.textContent = "بارگذاری صداها...";
        const loadPromises = sounds.map(sound => loadSound(sound));
        await Promise.all(loadPromises);
        playPauseBtn.disabled = false;
        playPauseBtn.textContent = "پخش";
        console.log("All sounds loaded");
    }

    function createSequencerGrid() {
        sequencerGridDiv.innerHTML = '';
        stepIndicatorsDiv.innerHTML = '';
        pattern = [];

        for (let i = 0; i < numSteps; i++) {
            const indicator = document.createElement('div');
            indicator.classList.add('step-indicator');
            indicator.textContent = i + 1;
            indicator.dataset.stepIndex = i;
            stepIndicatorsDiv.appendChild(indicator);
        }

        sounds.forEach((sound, soundIndex) => {
            const trackDiv = document.createElement('div');
            trackDiv.classList.add('track');

            const trackInfoDiv = document.createElement('div');
            trackInfoDiv.classList.add('track-info');
            trackInfoDiv.textContent = sound.name;
            trackDiv.appendChild(trackInfoDiv);

            const stepsDiv = document.createElement('div');
            stepsDiv.classList.add('steps');

            pattern[soundIndex] = [];

            for (let stepIndex = 0; stepIndex < numSteps; stepIndex++) {
                const stepButton = document.createElement('button');
                stepButton.classList.add('step');
                stepButton.dataset.soundIndex = soundIndex;
                stepButton.dataset.stepIndex = stepIndex;
                stepButton.addEventListener('click', () => toggleStep(soundIndex, stepIndex, stepButton));
                stepsDiv.appendChild(stepButton);
                pattern[soundIndex][stepIndex] = false;
            }
            trackDiv.appendChild(stepsDiv);
            sequencerGridDiv.appendChild(trackDiv);
        });
        updatePlayheadVisuals();
    }

    function toggleStep(soundIndex, stepIndex, stepButton) {
        initAudioContext();
        pattern[soundIndex][stepIndex] = !pattern[soundIndex][stepIndex];
        stepButton.classList.toggle('active', pattern[soundIndex][stepIndex]);

        if (pattern[soundIndex][stepIndex] && sounds[soundIndex].buffer) {
            playSound(sounds[soundIndex]);
        }
    }

    function updateGridFromPattern() {
        sequencerGridDiv.querySelectorAll('.step').forEach(stepButton => {
            const soundIndex = parseInt(stepButton.dataset.soundIndex);
            const stepIndex = parseInt(stepButton.dataset.stepIndex);
            if (pattern[soundIndex] && pattern[soundIndex][stepIndex] !== undefined) {
                stepButton.classList.toggle('active', pattern[soundIndex][stepIndex]);
            } else {
                stepButton.classList.remove('active');
            }
        });
    }

    function playSound(soundObj) {
        if (!audioContext || !soundObj.buffer) return;
        const source = audioContext.createBufferSource();
        source.buffer = soundObj.buffer;
        source.connect(audioContext.destination);
        source.start(0);
    }

    function scheduler() {
        sequencerGridDiv.querySelectorAll(`.step.playhead`).forEach(el => el.classList.remove('playhead'));
        stepIndicatorsDiv.querySelectorAll(`.step-indicator.playhead-indicator`).forEach(el => el.classList.remove('playhead-indicator'));

        sequencerGridDiv.querySelectorAll(`.step[data-step-index="${currentStep}"]`).forEach(el => el.classList.add('playhead'));
        const currentIndicator = stepIndicatorsDiv.querySelector(`.step-indicator[data-step-index="${currentStep}"]`);
        if (currentIndicator) currentIndicator.classList.add('playhead-indicator');

        for (let i = 0; i < sounds.length; i++) {
            if (pattern[i] && pattern[i][currentStep]) {
                playSound(sounds[i]);
            }
        }
        currentStep = (currentStep + 1) % numSteps;
    }

    function updatePlayheadVisuals() {
        sequencerGridDiv.querySelectorAll('.step.playhead').forEach(el => el.classList.remove('playhead'));
        stepIndicatorsDiv.querySelectorAll('.step-indicator.playhead-indicator').forEach(el => el.classList.remove('playhead-indicator'));

        if (isPlaying) {
            sequencerGridDiv.querySelectorAll(`.step[data-step-index="${currentStep}"]`).forEach(el => el.classList.add('playhead'));
            const currentIndicator = stepIndicatorsDiv.querySelector(`.step-indicator[data-step-index="${currentStep}"]`);
            if (currentIndicator) currentIndicator.classList.add('playhead-indicator');
        } else {
            const firstIndicator = stepIndicatorsDiv.querySelector(`.step-indicator[data-step-index="0"]`);
            if (firstIndicator) firstIndicator.classList.add('playhead-indicator');
        }
    }

    function startPlayback() {
        if (isPlaying) return;
        initAudioContext();
        if (audioContext.state === 'suspended') {
            audioContext.resume();
        }
        isPlaying = true;
        playPauseBtn.textContent = 'توقف';
        // currentStep = 0; // ریست کردن اگر میخواهید همیشه از اول شروع شود
        const intervalTime = (60 / bpm) * 1000 / 4;
        scheduler();
        intervalId = setInterval(scheduler, intervalTime);
    }

    function stopPlayback() {
        if (!isPlaying) return;
        isPlaying = false;
        playPauseBtn.textContent = 'پخش';
        clearInterval(intervalId);
        intervalId = null;
        updatePlayheadVisuals();
    }

    playPauseBtn.addEventListener('click', () => {
        if (isPlaying) {
            stopPlayback();
        } else {
            startPlayback();
        }
    });

    bpmInput.addEventListener('input', () => {
        bpm = parseInt(bpmInput.value);
        if (isPlaying) {
            stopPlayback();
            startPlayback();
        }
    });

    stepsCountSelect.addEventListener('change', () => {
        const newNumSteps = parseInt(stepsCountSelect.value);
        if (newNumSteps !== numSteps) {
            if (isPlaying) stopPlayback();
            numSteps = newNumSteps;
            currentStep = 0;
            createSequencerGrid();
        }
    });

    savePatternBtn.addEventListener('click', () => {
        const patternName = patternNameInput.value.trim();
        if (!patternName) {
            alert("لطفا یک نام برای پترن وارد کنید.");
            return;
        }
        const patternData = {
            name: patternName,
            bpm: bpm,
            numSteps: numSteps,
            pattern: pattern
        };
        localStorage.setItem(`drumPattern_${patternName}`, JSON.stringify(patternData));
        alert(`پترن "${patternName}" ذخیره شد.`);
    });

    loadPatternBtn.addEventListener('click', () => {
        const patternName = patternNameInput.value.trim();
        if (!patternName) {
            alert("لطفا نام پترنی که میخواهید بارگذاری کنید را وارد کنید.");
            return;
        }
        const savedPattern = localStorage.getItem(`drumPattern_${patternName}`);
        if (savedPattern) {
            if (isPlaying) stopPlayback();
            try {
                const patternData = JSON.parse(savedPattern);
                patternNameInput.value = patternData.name;
                bpmInput.value = patternData.bpm;
                bpm = patternData.bpm;

                const stepsOptionExists = Array.from(stepsCountSelect.options).some(opt => opt.value == patternData.numSteps);
                if (!stepsOptionExists) {
                    console.warn(`تعداد پله های پترن (${patternData.numSteps}) با گزینه های موجود متفاوت است.`);
                }
                stepsCountSelect.value = patternData.numSteps;

                numSteps = patternData.numSteps;
                pattern = patternData.pattern;

                createSequencerGrid();
                updateGridFromPattern();
                currentStep = 0;
                updatePlayheadVisuals();

                alert(`پترن "${patternData.name}" بارگذاری شد.`);
            } catch (e) {
                alert("خطا در بارگذاری پترن. فرمت داده نامعتبر است.");
                console.error("Error parsing saved pattern:", e);
            }
        } else {
            alert(`پترنی با نام "${patternName}" یافت نشد.`);
        }
    });

    loadAllSounds();
    createSequencerGrid();
});